def main():
	s = input()
	ans = 0
	for i in range(len(s)):
		if s[i]!= '0':
			continue
		else:
			ans += 1
			continue
		break
	# print(ans)

	t = [int(i) for i in s]
	t.sort()
	# print(t)

	idx = [0] * 6
	for i in range(len(t)):
		idx[t[i]] += 1

	for i in range(len(idx)):
		if idx[i]!= 0:
			ans += 1
			idx[i] -= 1

	print(ans)


